export class Mapa extends Component {

    constructor(props) {
        super(props);
    }



    componentDidMount() {
        console.log("emtrp did mount")
        //Avisa que quiere escuchar las posiciones de los conductores
        var objSend = {
            component: "seguimientoConductor",
            type: "startAll",
            estado: "cargando",
        };
        this.props.state.socketReducer.send(objSend);

    }
    componentWillUnmount() {
        //Termina de escuchar
        console.log("emtrp will mount")
        var objSend = {
            component: "seguimientoConductor",
            type: "stopAll",
            estado: "cargando"
        };
        this.props.state.socketReducer.send(objSend);
    }

    
    render() {
        if(!this.props.state.seguimientoConductorReducer.data){
            return <div/>
        }

        var getSVGMapa = () => {
            console.log("askjashfklasdklf");
            return Object.keys(this.props.state.seguimientoConductorReducer.data).map((key) => {
                var obj = this.props.state.seguimientoConductorReducer.data[key];
                return (
                    <MiMarker
                        lat={obj.latitude}
                        lng={obj.longitude}
                        
                    />
                )
            })
        }
        return (
            <div style={{ height: '100vh', width: '100%' }}>
                <GoogleMapReact
                    bootstrapURLKeys={{ key: "AIzaSyAt-U-cFcg5QNfPAvQW5YWT1d1SbEJFNuM" }}
                    defaultCenter={{
                        lat: -17.7799998333333332,
                        lng: -63.180598333333336
                    }}
                    defaultZoom={11}
                >
                    {
                        getSVGMapa()
                    }


                </GoogleMapReact>
            </div>
        )
    }
}


const initStates = (state) => {
    return { state }
};

export default connect(initStates)(Mapa);
